window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"19.1.2","implementation":{"name":"cucumber-jvm","version":"7.8.0"},"runtime":{"name":"Java HotSpot(TM) 64-Bit Server VM","version":"11.0.15.1+2-LTS-10"},"os":{"name":"Windows 11"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":1687485231,"nanos":541206100}}},{"source":{"uri":"classpath:features/Home.feature","data":"@jenkins\nFeature: Retail Home Page\n\n  Background: \n    Given User is on retail website\n\n  @home1 @regression\n  Scenario: Verify Shop by Department sidebar\n    When User click on All section\n    Then below options are present in Shop by Department sidebar\n      | Electronics | Computers | Smart Home | Sports | Automative |\n\n\t@home2 @regression @smoke\n  Scenario Outline: Verify department sidebar options\n    When User click on All section\n    And User on '<department>'\n    Then below options are present in department\n      | <optionOne> | <optionTwo> |\n\n    Examples: \n      | department  | optionOne                      | optionTwo                |\n      | Electronics | TV & Video                     | Video Games              |\n      | Computers   | Accessories                    | Networking               |\n      | Smart Home  | Smart Home Lightning           | Plugs and Outlets        |\n      | Sports      | Athletic Clothing              | Exercise & Fitness       |\n      | Automotive  | Automative Parts & Accessories | MotorCycle & Powersports |\n\n\t@home3 @regression\n  Scenario: Verify User can add an item to cart\n    Given User is on retail website\n    When User click on Sign in option\n    And User enter email 'email' and password 'password'\n    And User click on login button\n    And User should be logged in into Account\n    And User change the category to 'Smart Home'\n    And User search for an item 'kasa outdoor smart plug'\n    And User click on Search icon\n    And User click on item\n    And User select quantity '2'\n    And User click
